B.D9=new A.a5(4,{key:B.iC,title:"Dearest Joie",date:"June 21 1950",entry:"     Dearest Joice, \n\n     Well you certainly are back to your old self again. What do you need something new every minute - as soon as the house & job get old you go back into the doldrums again. \n\n     If you have no news at least I have and most encouraging. I seem to be making some progress at Crane & Co and I am definitely going to to be working on improvement of currency paper. This will be fine since I'll be left pretty much on my own and will at least be doing something constructive. My many ideas for improving Crane & Co's research program have faired much better than I expected, several being quite strongly in favor of them, Bruce for one, so there may be quite a few changes within the year. All of this is extremely pleasing to me and has improved my moral and outlook on life in Dalton. \n\n     My little house is moving slowly due to the present occupants but I am hoping that something will break soon. I have many ideas and I can't wait to put them into action. Though I haven't seen Donny yet rumor has it that he is most willing to move in with me. \n\n     I am quite boyed[?] up about buying a plane and think I have a chance for the same one I flew down to Wash in. If I can get it for the right price I think it would be a good bym being in good shape without too much time on it. So the next time you hear from me I may be an owner. \n\n     Last weekend I went down to the Cape and had a delightful time. The weather was excellent and we had much sailing and tennis. Jim and Marge were there with their small one who looks just like Jim - not the prettiest child but very cute. I think it was the struggle with the traffic going down more than anything else that has convinced me of the need for a better mode of transportation, and the prospect of facing it all again this weekend is tempting me to go right out and get a plane tomorrow. \n\n     Gib, Jean, Donny etc are all going down to out house for our annual house-party which should be most pleasant - except for to long drive to and from. I'm very sorry you and Pam won't be with us and I shall miss you very much. \n\n     I heard from Pam that the supper party was a great success and that you did quite a job on Garner - Miss Joicie[?] at work (that type) is always a pleasure to contemplate. \n\n     Joie dear, at times like these I think what you want most is affection, and you know that I am only too willing to comply but sometimes you make it awfully difficult. I try my hardest but I feel sometimes it is quite inadequate, but admittedly it is difficult to do onesided at a distance. \n\n     Anyway my very best to all in Wash ans I'll be down to see you in \"my plane\" soon, I hope, if you like. \n\n     All my love to you \u2e3a \n\n     Affectionately \n\n    \n\n Fred"},B.B3,t.R)
B.Df=new A.a5(7,{key:B.iD,title:"To JSK ",date:"1 December 1950",beforeEntry:null,entry:"     I suppose I am angry with you because you have caused the fall of another of my castles and so I must speak my piece in order to salvage at least some respect in my judgement. \n\n     When I first went tumbling into your lap you were an almost perfect answer to my prayer, not perfect because you wouldn't tumble back; but nonetheless as I have explained many times you did well enough and kept me very contented. Your affection, discipline, and appreciation of my sex appeal did a lot to restore my ego an self confidence. Because you did so much for me I have casually, naturally turned to you in time of need. This time I looked and knew you wouldn't be there. \n\n     Last night I sat down to write you a letter because I was having a moment of indecision and wanted to have someone to discuss it with. It was about the national crisis and what my feelings and actions should be. I started the letter to you - naturally turning to the person I felt closest too - and the letter went to Pam. \n\n     You see Joice in a time of crisis like that, you turn to someone for strength and guidance and it is only a person very close to whom you can turn. Sex and momentary affection don't pay off at such a time. You say that what I was asking for you couldn't give, love; but I say that's not the whole story. Love is wonderful but its a couple of the things that make it up that I wanted and could find in a person I'm not in love with. \n\n     Before one can show that much of oneself to anyother you must be sure of two things, true affection and an honest attempt to understand. Your affection has always been momentary and I have never seen you display what I term true affection. A caress, a conversational or assumed interest, a note of respect, a token of appreciation, all are the outward signs of affection. \n\n     You pride yourself on being affectionate and every one of those outward manners you have to high degree - but whats under it? It's not the outward signs that are affection, its the motivating force and what is yours? Why do your outward gestures fail over a distance or over a period of time. Why the lack of a feeling of responsibility? - No motivation, no affection,. Analyze it yourself and see. From an outward sense your perfect and only so can you get away with so much lack of effort. This will work in most cases but you for anyone in love with you or for any man considering you as a wife. \n\n     The other point, an honest attempt to understand me, is also pertinent. I know that it is really impossible to understand another, but the attempt is most important. Here again you show all the outward signs of interest and are interested in all the surface things. But what about underneath. A hundred times I've hoped you'd ask me what ticked under my skin and a hundred times I've tried to give all of me but no result, no interest. You can't give it and so you won't accept it. Janet was like that only at least she tried and she could accept it. \n\n     I don't know why I tell you this, maybe others have told you - maybe they haven't but some one should. Maybe thats why I could say to myself though I'm very in love I'll never marry you. So now Miss J you can have what you've said you wanted, sex and no responsibilities.  ",afterEntry:null,additionalContent:null},B.o,t.R)
B.De=new A.a5(7,{key:B.iz,title:"The Navy and Me",date:"2 January 1951",beforeEntry:null,entry:"     Although for the moment the international situation is not as bad as it first appeared it is still extremely bleak. Russia's objective is all too apparent; the destruction of the only obstacle in her path to world domination, the U.S.A. She apparently does not want an open fight if it can be avoided, but it is obvious that she is not scared of us and will not go too dar to avoid it. We evidently have a few months breathing spell and if we arm sufficiently we may have more. But arm we must and to the full extent of our resources. We have gone much too slowly and the worst comment on our present state of instability is that I have any decision to make. I and all like me should have been called or told that we would be called long ago. We should have mobilized immediately when the Reds first stepped across the Manchurian boarder. \n\n     Feeling as strongly as I do that we should be filly mobilized at the moment, leaves me with a very strong moral pressure to go. Also looking at it slightly longer range view, I see no way in which some kind of struggle can be avoided for long. There is room for only one of us on this earth and either we oe they will dominate. From every one of Russia's actions we can see that from her point of view she must remove us and to prevent it we must be strong. The struggle must come within the next two years and very probably much sooner - a matter of months. This leaves me feeling that my existance as present is really quite useless. Seeing this struggle coming I should be preparing myself to do all I can to prepare myself for it. Instead of making paper I should be practicing how to be a better officer. \n\n     Then there is the feeling of the futility of working as if nothing were going to happen. What is the use of being a better paper-maker when what is needed is a better naval officer. It becomes very frustrating to plan and work toward various goals only to know that you cannot even see them well on their way and worse to see the importance of those goals vanish in a war. \n\n     To get to a more practical side, what is a matter of a few months anyway. If I were married those few months might be very important but I'm not. The few months of my present life left to me are not worth it, if I can be of service elsewhere. And if by going in now I can take more active and successful part in the approaching war, the sacrifice was well worth it.",afterEntry:null,additionalContent:null},B.o,t.R)
B.Dz=new A.a5(7,{key:B.iA,title:"The Need For Guts",date:"January 1951",beforeEntry:null,entry:"     It is easy to see that my praise and flattery were much too premature and that without further ado you have sunk to your old self again. I must admit that my flattery was spoken by way of encouragement for a good beginning but without much faith in in its continuance and I see my lack of confidence is justified. You certainly show your true colors - a bit of ardent effort, discouragement and then complacence - right back where you started. \n\n     Joycie it is easy to see that you have no understanding of the word perseverance or the theory that a certain amount of continuous effort is the only way of accomplishing anything. This lack of perseverance runs through your whole character and to my way of thinking accounts for ninethenths of its short comings. Start with athletics, tennis skiing or golf - your lack of coordination never defeated you but merely the complete failure to try and try until you have beaten it and your own self (that tendance to quit when discouraged). This lack of coordination is merely an alibi to sooth your ego and protect your self respect. In every case where it is essentially a lack of true effort you always manufacture some nice reason why you are incapable. Look at this crape about being a dull person and not a brilliant wit conversationally - nuts - thats merely an alibi for the times when you just can't quite put out the effort to be yourself. If something doesn't come easily you withdraw into a little shell and then invent some nice fault so that you can indulge in some nice self criticism. \n\n     What always seems to go along with the lack of perseverance but lack of courage as well. So so often cobel[?] this no self-confidence but my positive little friend, you and I both know you really have plenty of that in every way except where it is actually doing something other than just talking, a lack of confidence. We have talked about your hard impersonal shell. It is merely a protective device to cover your lack of courage and perseverance (jointly guts). You hide behind this shell when you haven't the courage to expose your inner self and because you're afraid you may hurt yourself by your inability to really do a job. \n\n     Lack of self confidence, lack of guts, which causes which I don't know, but I do know that its only the courage and perseverance which will give you faith in yourself. You are your wont worst critic and most ineffective. You do the criticizing so that on one else will and thus you can deflect the fire to something less tender within you. It won't work! \n\n     You've got to try and try now because the older you get the harder it will be. What do you want in life, a husband, home & family but look at yourself; by your own admission a lousy risk. And essentially why? Coldness, no; selfishness, not really; but just a complacent lack of effort, and a withdrawal into yourself at the slightest fear of being hurt. We both know why that would make a wretched marriage companion. \n\n     All I want to impress on you is the need for Trying; just making an effort. This doesn't have to be any special effort in any particular direction but in everything, work, athletics, your relations with others and particularly your self. Your self discipline exercises and your lental[?] sacrifices were good. But mainly just keep trying. ",afterEntry:null,additionalContent:null},B.o,t.R)
B.DI=new A.a5(7,{key:B.iE,title:"Withdrawl?",date:"20 June 1951",beforeEntry:null,entry:"     The relationship - very physical (of primary importance) with considerable affection shown which is good for us both. Relations well established, likes & dislikes well known to each, much common experience and pleasure behind us. \n\n     PROS - There is no question but that the relationship has certain strong advantages for us both. On the physical side alone we both need and require it and it is nice to have someone to turn to for that release and pleasure. Both of us being rather affectionate by nature we both need some one to whom to spend our affection and also need someone to give it to use. This part is by no means an equal distribution over the long run but of the short term it is. We bot excercise a certain good and needed disciplinary effect over each other and I like to feel we have contributed to building up & bolstering certain good characteristics in both of us. Also we are congenial, compatable, and do have a great deal of fun together. Actually almost everything essential is there to make a happy marriage and there is a possibility that such might be the eventual outcome. \n\n     CONS - The essential and most important failure in the whole relationship is that Joyce does not love me. Thought I believe that she is much closer too it than she actually thinks, there are still many signs that there is a long wat to go for her. Her feelings for me are essentially stated above which are the essentials for love but just don't seem to be carried far enough in Joyce's case. Her affection is strictly short term and of the moment with very little lasting quality to it and her prime emotion as far as I'm concerned is physical. My feelings are deeper and I can honestly say there are many times when I would have been and was utterly in love, but that is wearing thin now. I still could be in love if I sincerely thought it was recipricated and if I thought I could really exert a real discipling influence on her. I want her and I need her but not to the extent I previously did. \n\n     Further argument against it is that as things stand now the raod is only down hill. The best has been - not \"yet to be\". I guess I'm old fashioned but there is something that has to accompany pure physical pleasure in order to give real satisfaction. That has been and under the present set up that something will become less and less and our relationship will become more and more degrading to both of us. So far most of the giving has come form me and as that lessens as it is bound to do unless there is some stimulation, the affectionate side of this will become more and more meaningless, with the accompanying debasing of the act and our selves. \n\n     The third reason for my feeling against continuing is Joyce's moral feeling about this whole thing. I can not really understand her view point or if I understand it I don't like it. So lone as it could be justified by a strong possibility of love and very strong affection I could justify it in my mind and still respect her for it. But as this thing goes on and less and less comes of it I cannot continue to hold respect for her. So that from now on she degrades in my eyes. And she does degrade rather badly when I add this to some of the things she likes to say about herself which I have never really believed. \n\n     CONCLUSION - I must drop this relationship now in order to maintain my self-respect (important above all I have found) and in order to keep a few good happy memories of the affair. I cannot go through another J.W. affair and I cannot let this fold slowly of its own weight. It must stop now quick and be frozen at its best rather than at its bottom. Also it may do Joyce some considerable good and perhaps awake in her some healthy and worthwhile feeling.",afterEntry:null,additionalContent:null},B.o,t.R)
B.DJ=new A.a5(7,{key:B.iF,title:"Finis JSK",date:"1 September 1957",beforeEntry:null,entry:"     I wouldn't count on too much correspondance from me in the future because as I said it is too hard for me to switch from one role to another. Things being as they are I've just got to get used to forgetting about you. \n\n     For this reason I'd like to get in my last session of lecturing since I won't have another chance. If you want to keep from the miseries of self condemnation you've got to learn to live with yourself and your world - neither are perfect. You are too critical or expect too much of both yourself and others; your goals are not necessarily too high but your adjustment to the inadaquacies of others & yourself is at fault. I say, Joyce, that for you to be happy you've got to learn to pick the essential and important from the trivial and bear down on those that are important - this foes for you and others. \n\n     As you are now you are just as strong on your critisim of small things as on big things & thus the effect is lessened. As a consequence you spend a deal of time in critisizing yourself on minor matters and overlook the important ones. It is good for you to be living with Betsy as she is one of the best examples of a person who can immediately know what is important to her and what isn't. She, as far as I've seen, has never been bogged down by small items and as a consequence is a very well adjusted person. - you are not. Self critisim is a good thing when it is effective and to keep it effective it must be used sparingly otherwise you just [restrict] yourself to critisism of others and lose your oen confidence - an unhappy state. \n\n     Another item which I have harped on before is effort. You've got to learn to be a fighter and to make yourself do things. In general things have been pretty easy for you but it isn't so now, you've got to exert yourself. You've got to exert yourself for others and accept responsibility which others thrust on you. By this I mean things like the old subject of letters as well as exerting yourself to see and like people. This sounds [funny] coming from me since you were about to critisize me on the same subject. But out situations are much different; with me it is the exterior that is a fault, with you the interior. Your social graces are excellent, conversationally, looks, charm, and all but it is all exterior and there is nothing of yourself really in it. You can accept from others but you really give very little of yourself. Until you know someone very intimately you give a person very little that is under that shell of yours. That Joie, is why you mutter and [accuse] yourself for being anti-social and why you say that sex must be entered into before you can relax with a man. That is bad and you can only overcome it by making a consiencous effort to give. This is nothing more than the same old story of affection that I've always harped on. To give you must put something of yourself into it - not just surface fixtures. \n\n     And now to the third thing - sex. I don't think you should have another affair such as ours, since I think it would be very bad for you. In the first place you must learn to give without sex and before it and more important it is degrading. Its the old case of where do you draw the line; where does promiscuity begin and need & friendliness end. No, Joie I think you should leave it alone for a long time and use a little self control (it would be good for you). As the old saying goes, if there's enough love to make it right then you should marry him - otherwise its wrong. That statement just about covers my belief on the subject and is one reason it has been so hard for me to understand our relationship. And it is why I've wanted so desperately to find some expressed emotion from you to make it right. No on can really say or be much help on this subject - its up to you, but I would advise staying away from it because I'm afraid that sex more than anything could turn you into a very hard person. \n\n     And now I just want to say Joie, that you have, and at the moment still do, mean more to me than anyone ever has. I have a great deal to be thankful for despite my feelings. Considering the situation you have been very good to me and have kept hurt to a minimum. My plan has always been to try to make you so dependent on me that you couldn't leave but I see that more than just dependancy is needed and my plan has failed. You've got to find something which will make you do those things yourself. You would no longer be the old independant Joie, if you had to depend constantly on someone and I wouldn't love you for long. Don't count on a \"Mr Right\" because it won't work that way & he doesn't exist. Mr Right will come when you've got things fixed with yourself and are ready for him.",afterEntry:null,additionalContent:null},B.o,t.R)
